import React, { Component } from 'react';
import $ from 'jquery';
import 'jquery-ui-bundle';
import 'jquery-ui-bundle/jquery-ui.css';
import Child from './AdminParentsChild';

class AdminParentProfile extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            childData : [
                {
                    id : 1,
                    name : 'Villa Myo',
                    year : 'Fourth Year',
                    section : 'B'
                },
                {
                    id : 2,
                    name : 'Myo Myat Aung',
                    year : 'Final Year',
                    section : 'B'
                }
            ]
         }
    }
    componentDidMount() {
        $(function(){
            $('.datepicker').datepicker();
          });
          this.setState({
        
          })
    }
    render() { 
        let child_datas = this.state.childData;
        const childComponents = child_datas.map(function(child){
        return <Child key={child.id} name={child.name}/>
        });
        return ( 
            <div>
                <div className='container'>
                    <h2 className='mt-4'>Guardian Info</h2>
                    <div className='col-lg-8'>
                        <div className='card' style={{width:'100%',padding:'4px'}}>
                            <form>
                                <div className='row mt-2'>
                                    <div className='col'>
                                    <label>Name</label>
                                    <input type="text" className="form-control" placeholder=""/>
                                    </div>
                                    <div className='col'>
                                    <label>Relationship</label>
                                    <input type="text" className="form-control" placeholder=""/>
                                    </div>
                                </div>

                                <div className='row mt-2'>
                                    <div className='col'>
                                    <label>Occupation</label>
                                    <input type="text" className="form-control" placeholder=""/>
                                    </div>
                                    <div className='col'>
                                    <label>SRC NO:</label>
                                    <input type="text" className="form-control" placeholder=""/>
                                    </div>
                                </div>

                                <div className='row mt-2'>
                                    <div className='col'>
                                    <label>Date Of Birth</label>
                                    <input type="text" className="form-control datepicker" placeholder="" />
                                    </div>
                                    <div className='col'>
                                    <label>Phone Number</label>
                                    <input type="text" className="form-control" placeholder=""/>
                                    </div>
                                </div>

                                <div className='row mt-2'>
                                    <div className='col'>
                                    <label>Address</label>
                                    <input type="text" className="form-control" placeholder=""/>
                                    </div>
                                </div>
                                <div className='row mt-4'>
                                <button type="button" className="btn btn-primary btn-lg btn-block">SAVE</button>
                                </div>
                            </form>
                        </div>
                    </div>
                    <div className='col-4'>
                        <div className='row' style={{paddingLeft : '48px',paddingRight:'48px'}}>
                            <div className='card' style={{width:'100%'}}>
                            <img src='data:image/jpeg;base64,' 
                                                className='rounded'
                                                alt='Guardian Profile'/>
                            </div>
                        </div>
                        <div className='row mt-2'>
                            <div className='card' style={{width : '100%'}}>
                                <div className='card-header'>
                                    Child INFO
                                </div>
                                <div className='col'>
                                    {
                                        childComponents
                                    }
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
         );
    }
}
 
export default AdminParentProfile;
